import './App.css';
import Header from './components/header/Header';
import {BrowserRouter as Router,Route,Switch} from 'react-router-dom';
import AddNotes from './components/AddNotes';
function App() {
  return (
    <div className="App">
    <Router>
        <Header />
        <Switch>
        <Route exact path="/"/>
          <Route path="/addnotes" component={AddNotes}/>

        </Switch>
      </Router>

    </div>
  );
}

export default App;
